import React from "react";

const Content = (props) => {
  const parts = "";
  for (let i = 0; i < props.parts.length; i++) {
    parts = "<p>{props.parts[i]} {props.exercises[i]}</p>";
  }
  return <>{parts}</>;
};
export default Content;
